description:
Category	Feature, Parody / Spoof

Starring	Adrianna Luna, Cassidey, Christie Stevens, Evan Stone, Anthony Rosano, Xander Corvus, Seth Gamble, Ryan Driller, Ryan McLane, Macy Cartel, Natalia Moore

The Wild West was one of the most exciting times in American history. From it stemmed great tales of legendary heroes and dastardly villains. One such great tale was The Lone Ranger and his run-ins with Butch Cavendish. In our story, Butch and his gang ambush The Texas Rangers in an attempt to take over the territory. Butch's plan almost worked, except they failed to kill one ranger who was left for dead.


